import React from 'react'
import CustomBtn from '../../Components/CustomeBtn/CustomBtn'
import { Tabs } from '../../Components/StyledComponents/Index'
const NavTab = () => {
    return(
        <Tabs className='bg-[#00ff15] w-[2rem] items-center'>
            <CustomBtn
                text='message'
            />
        </Tabs>
    )
}

const ChatsProfileTabs = () => {
    return(
        <Tabs className='bg-[green] w-[15rem]'>
            <p>Tabs 2</p>
        </Tabs>
    )
}

const ChatsTabs = () => {
    return(
        <Tabs className='bg-[red]'>
            <p>Tabs 3</p>
        </Tabs>
    )
}

const Main = () => {
    return (
        <div className='flex flex-col items-center h-screen'>
            <div className="flex items-center bg-slate-400 w-[70%]">
                <NavTab/>
                <ChatsProfileTabs/>
                <ChatsTabs/>
            </div>
        </div>
        

    )
    
}

export default Main
